window.bookSummaryJSON = "<p>This bundle includes books four through six of Dirty Blood, a dark romantic fantasy series where a male vampire falls for a female human in the midst of a paranormal war.</p> <p><b><i>The Forsaken Vampire</i></b><br> The Leader of the Teeth commanded me to kidnap Princess Rolfe, but my simple task became immediately complicated when I felt how much she wanted me…</p> <p><b><i>The Broken Prince</i></b><br> Harlow is smart and fierce, and I should have known that she would cross me. Now I'm a prisoner under the castle—and once her father returns I'm as good as dead.</p> <p><b><i>Clash of Kingdoms</i></b><br> I had the chance to leave these lands and avoid the war—but I chose to stay to keep Harlow safe. Now I fight for more than just Harlow. I fight for her family…like they're my own.</p>"; 
